import React, { Fragment } from 'react';
import { Tabs, Tab } from '@material-ui/core';
import { Link, Route, Switch, BrowserRouter as Router } from 'react-router-dom/Route';
import Home from './../SS/Home';
import Sarees from './../SS/Sarees';


//<Route path="/contact-us" render={() => <div>Contact us</div>} />
//  <Tab label="Contact us" component={Link} to="/contact-us" />
const SSTabs = (props) => {
   const value = props.value;
   const handler = props.handleChange;
   return (
     <Fragment>
      <Tabs indicatorColor="primary" centered value={value} onChange={handler}>
        <Link label="Home" to="/"/>
        <Link label="Sarees"  to="/sarees"/>
      </Tabs>
     <Switch>
       <Route path="/" component={<Home/>} />
       <Route path="/sarees" component={<Sarees/>} />
     </Switch>
     </Fragment>

  );
}

export default SSTabs;
